import React from "react";

import classes from "./Header.module.css";

const Header = (props) => {
  return (
    <header
      className={classes.header}
      style={{
        backgroundColor: `${props.bgColor}`,
      }}
    >
      <h1 style={{ color: `${props.titleColor}` }}>sam portfolio</h1>
    </header>
  );
};

export default Header;
